import base64
import cv2
import numpy as np

def fix_base64_padding(base64_str):
    """Ensure the base64 string has the correct padding."""
    return base64_str + '=' * (4 - len(base64_str) % 4) if len(base64_str) % 4 != 0 else base64_str

def decode_base64_to_image(base64_str, output_filename="decoded_image.png"):
    """Decode a base64 string and save it as an image."""
    try:
        # Fix padding if necessary
        base64_str = fix_base64_padding(base64_str)

        # Decode base64 string
        frame_data = base64.b64decode(base64_str)
        np_arr = np.frombuffer(frame_data, np.uint8)
        frame = cv2.imdecode(np_arr, cv2.IMREAD_COLOR)

        if frame is None:
            print("Failed to decode image")
        else:
            print(f"Image decoded successfully, saving as {output_filename}")
            cv2.imwrite(output_filename, frame)  # Save the image to a file
            print(f"Image saved as {output_filename}")

    except Exception as e:
        print(f"Error decoding image: {e}")

# Sample base64 string (replace with your actual base64 string)
base64_str = "data:image/jpeg;base64,"

# Call the function to decode and save the image
decode_base64_to_image(base64_str)
